import React from "react";
import Navbar from "./components/Navbar";
import AboutMe from "./components/AboutMe";
import {
  BrowserRouter,
  Route,
  Link
} from "react-browser-router";

function App() {
  return (
    <BrowserRouter>
      <div className="box">
      <Navbar />
      <AboutMe />
      </div>
    </BrowserRouter>

  );
}

export default App;
